    struct Ball {
        uint64 ballId;
        address owner;
        uint256 seasonId;
        uint256 revealGroup;
    }

    constructor() {
        _ballIds.increment();
        _revealGroups.increment();

    } 

    mapping(uint256 => Season) public seasons;
    mapping(address => mapping(uint256 => uint64[])) public userBalls; //userAddr => SeasonId => BallId
    mapping(uint256 => uint256) public revealGroupSeeds; // revealGroup => revealSeed
    mapping(uint64 => Ball) public balls; // ballId => Ball struct


    function issueBalls() external returns (bool) {

    }

    function startSeason() external returns (uint256) {
        _seasonIds.increment();
        uint256 _seasonId = _seasonIds.current(); 
        seasons[_seasonId] = 
                Season(_seasonId, 
                        uint64(_ballIds.current()), 
                        uint64(0), 
                        uint64(0),
                        uint256(0));

        return _seasonIds.current();
    }

    function getCurrentSeason() public returns (Season memory) {

    }
    function getCurrentSeansionId() public view returns (uint256) {
        return _seasonIds.current();
    }

    function setSeasonWinningCode(uint256 seed) public returns (bool) {
        seasons[getCurrentSeansionId()].winningCode = extractCode(seed);
        return true;
    }

